css:
.merge-conflicts .navigate {
  cursor: pointer;
}
.merge-conflicts .navigate:hover {
  background-color: rgba(255, 255, 255, 0.07);
}
.merge-conflicts span.icon-fold {
  cursor: pointer;
}
.merge-conflicts span.icon-unfold {
  display: none;
  cursor: pointer;
}
.merge-conflicts.minimized span.icon-fold {
  display: none;
}
.merge-conflicts.minimized span.icon-unfold {
  display: inline-block;
}
.merge-conflicts-message {
  cursor: pointer;
}
.resolver.save-needed .save .text-success {
  display: none;
}
.resolver.save-needed .save .text-status {
  display: inline-block;
}
.resolver.save-needed .stage {
  display: none;
}
.resolver.stage-needed .stage .text-success {
  display: none;
}
.resolver.stage-needed .stage .text-status {
  display: inline-block;
}
.resolver .save .text-status {
  display: none;
}
.resolver .stage .text-success {
  display: none;
}
.panes .pane .item-views > .react > .overlay.resolver {
  left: 50%;
  padding: 10px;
  bottom: auto;
}
.editor .conflict-resolved {
  background: rgba(255, 255, 255, 0.07);
}
.editor.conflicted .conflict-ours {
  background: #207b4a;
}
.editor.conflicted .conflict-ours.cursor-line {
  background: #155231;
}
.editor.conflicted .conflict-theirs {
  background: #146297;
}
.editor.conflicted .conflict-theirs.cursor-line {
  background: #0e456a;
}
.editor.conflicted .conflict-dirty {
  background: #433d03;
}
.editor.conflicted .conflict-dirty.cursor-line {
  background: #746a05;
}
.editor.conflicted .side {
  padding: 0 20px;
  width: 100%;
  position: absolute;
  left: 0;
}
.editor.conflicted .side span {
  margin-left: 10px;
}
.editor.conflicted .side span.pull-right {
  clear: right;
  margin-right: 20px;
}
.editor.conflicted .side button.revert {
  display: none;
}
.editor.conflicted .side.top {
  border-top-left-radius: 5px;
  border-top-right-radius: 5px;
}
.editor.conflicted .side.top button {
  margin-top: 5px;
}
.editor.conflicted .side.bottom {
  border-bottom-left-radius: 5px;
  border-bottom-right-radius: 5px;
}
.editor.conflicted .side.bottom button {
  margin-top: -35px;
}
.editor.conflicted .side.dirty {
  background-color: #f5e11d;
}
.editor.conflicted .side.dirty button.revert {
  display: inline-block;
}
.editor.conflicted .navigation {
  padding: 0 20px;
  background: #292c2f;
  width: 100%;
  position: absolute;
  left: 0;
}
.editor.conflicted .navigation span.pull-right {
  clear: right;
  margin-right: 20px;
}
.editor.conflicted .navigation button {
  margin-left: 5px;
  margin-top: -15px;
}
